export const url = ""
export const doPost = (setter, data, endpoint) => {
    fetch(`${url}/${endpoint}`, {

    method: "POST",
    body: data,
    headers: {
        "Content-type": "application/json; charset=UTF-8"
    }
})
.then(response => response.json()).then(data => setter(response))
//setter(response)
}

